import React, { Component, Fragment } from 'react';







class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            HoTen : '',
            Email : '',
            SoDT : '',
            TaiKhoan : '',
            MatKhau : '',
            MaLoaiNguoiDung : '',

        }
    }
    render() {
        return (
            <Register/>
        )
    }
}

export default Register;
